import Colors from "../css/Colors";

const CreatedByPageStyle = {
    headerShown: true,
    headerTitle: "Filter By: Created By",
    headerTintColor: Colors.whiteColor,
    headerStyle: {
      backgroundColor: Colors.pageBgColor,
    },
}

export default CreatedByPageStyle
